CBRE is pleased to present Lots 97 & 100 Camden Valley Way, Edmondson Park to the market for sale on behalf of our client, Defence Housing Australia. This terrific development site is an extremely rare opportunity and should not be overlooked.

The property boasts the following key attributes:
- Huge site area - 8,883sqm* of premium development land; 
- Dynamic zoning of B6 Enterprise Corridor which allows for a wide range of uses including retail and shop top housing;
- Positioned along Camden Valley Way, a major arterial road servicing South West Sydney with vehicular traffic of 52,000* cars per day;
- Located within a booming growth suburb with brand new housing and upcoming retail precincts; 
- Join national retail operators such as McDonalds, Anytime Fitness, ALDI, Oporto and First Choice Liquor already in the precinct;
- Close proximity to the newly developed Edmondson Park Train Station (2.4km* - 5 minutes via vehicular travel); 
- Liverpool CBD is only 8km* from the property and a direct route into the city; 
- Close proximity to future Badgerys Creek Airport, minutes from the Hume Highway and M5 and M7 motorways.

The Edmondson Park median house price has increased 54%* over the past 5 years to $882,000 and will no doubt continue to increase as the suburb further develops. (Source: REA Group) 

To discuss the property in more detail, please be in contact with the CBRE team. 

Alex Mirzaian - 0400 523 523

